'''
ou are given two integer arrays nums and multipliers of size n and m respectively, where n >= m. The arrays are 1-indexed.
You begin with a score of 0. You want to perform exactly m operations. On the ith operation (1-indexed), you will:
Choose one integer x from either the start or the end of the array nums.
Add multipliers[i] * x to your score.
Remove x from the array nums.
Return the maximum score after performing m operations.

Example 1:
Input: nums = [1,2,3], multipliers = [3,2,1]
Output: 14
Explanation: An optimal solution is as follows:
- Choose from the end, [1,2,3], adding 3 * 3 = 9 to the score.
- Choose from the end, [1,2], adding 2 * 2 = 4 to the score.
- Choose from the end, [1], adding 1 * 1 = 1 to the score.
The total score is 9 + 4 + 1 = 14.

Example 2:
Input: nums = [-5,-3,-3,-2,7,1], multipliers = [-10,-5,3,4,6]
Output: 102
Explanation: An optimal solution is as follows:
- Choose from the start, [-5,-3,-3,-2,7,1], adding -5 * -10 = 50 to the score.
- Choose from the start, [-3,-3,-2,7,1], adding -3 * -5 = 15 to the score.
- Choose from the start, [-3,-2,7,1], adding -3 * 3 = -9 to the score.
- Choose from the end, [-2,7,1], adding 1 * 4 = 4 to the score.
- Choose from the end, [-2,7], adding 7 * 6 = 42 to the score.
The total score is 50 + 15 - 9 + 4 + 42 = 102.


Constraints:
n == nums.length
m == multipliers.length
1 <= m <= 103
m <= n <= 105
-1000 <= nums[i], multipliers[i] <= 1000
'''
from functools import lru_cache
import sys
sys.setrecursionlimit(10000)
class Solution:
    @lru_cache(maxsize=1280000)
    def rec(self, n_a, m_a):
        if m_a >= len(self.multipliers):
            return 0
        o1 = self.rec(n_a+1, m_a+1)+self.nums[n_a]*self.multipliers[m_a]
        n_b = n_a + len(self.nums) - m_a
        o2 = self.rec(n_a, m_a+1)+self.nums[n_b-1]*self.multipliers[m_a]
        return max(o1, o2)
    def maximumScore2(self, nums, multipliers) -> int:
        self.nums = nums
        self.multipliers = multipliers
        # self.c = 0
        res = self.rec(0, 0)
        # print(self.c)
        return res

    def maximumScore(self, nums, multipliers):
        n = len(nums)
        m = len(multipliers)
        ht = [[0 for _ in range(m+1)] for _ in range(m+1)]
        for j in range(m-1, -1, -1):
            for i in range(j, -1, -1):
                o1 = ht[i+1][j+1]+nums[i]*multipliers[j]
                n_b = i + len(nums) - j
                if n_b - 1 < len(nums):
                    o1= max(o1, ht[i][j+1]+nums[n_b-1]*multipliers[j])
                ht[i][j] = o1
        return ht[0][0]

